import React from 'react';
import Content from './components/Content';
import logo from './assets/logo.png'; // ✅ 내부 이미지
import './App.css';

function App() {
  return (
    <div className="App">
      <h1 style={{ textAlign: 'center', marginTop: '30px' }}>콘텐츠 카드들</h1>

      <Content
        image = {logo}
        title = "첫 번째 콘텐츠"
        description = "제발"
      />

      <Content
        image = {logo}
        title = "두 번째 콘텐츠"
        description = "ww"
      />
    </div>
  );
}

export default App;
